    public Cancel cancelOrder(String uuid) throws IOException
        {
            final String url = "https://bittrex.com/api/v1.1/market/cancel";
            HashMap<String, String> oid = new HashMap<String, String>();
            oid.put("uuid", uuid);
            String cancelStr = new RESTUtil().callRestHttpClient(url, key, secret, oid);
            ObjectMapper mapper = new ObjectMapper();
            Cancel cancel = mapper.readValue(cancelStr, Cancel.class);

            return cancel;

        }


